import React, { useState } from "react";

function ViewInvitations() {

    const [invitations, setInvitations] = useState("");

    useEffect(() => {
        // Fetch data from the backend server
        axios
          .get("http://localhost:3007/invitations")
          .then((response) => {
            setInvitations(response.data);
          })
          .catch((error) => {
            console.error("Failed to fetch invitations:", error);
          });
      }, []);

  return (
    <div className="container">
      <table className="table">
        <caption>List of Invitations Sent to Branches</caption>
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">Connection ID</th>
            <th scope="col">Invitation</th>
            <th scope="col">Invitation URL</th>
            <th scope="col">Status</th>
            <th scope="col">Action</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default ViewInvitations;
